css:
@-moz-document domain("facebook.github.io") {
  body, html{
      background-color: black;
      color: white;
  }

  .nav-docs .nav-docs-section>ul li a{
      color: white;
  }

  .nav-docs h3{
      color: white;
  }

  .hll, .highlight, .highlight:after{
      background-color: black;
      border-left: none;
      color: white;
  }

  code, .highlight .nx, .highlight .p, .highlight .err{
      color: white;
  }
}
